import React from "react";
import { Link } from "react-router-dom";

const linkStyle = {
  textDecoration: "none",
  color: "blue",
  padding: "5px",
  margin: "5px",
};

const Home = () => {
  return (
    <div style={{ textAlign: "center", marginTop: "20px" }}>
      <h1>Welcome to Shopping List App</h1>
      <Link to="/create" style={linkStyle}>
        Create a Shopping List
      </Link>
    </div>
  );
};

export default Home;
